import React from 'react'

export const Ticket = ({ allTickets, onDelete }) => {
    let style={
        margin: "50px",
        width: "50%",
        float: "middle"
    }
    return (
        <>
            <div style={style} className="card text-center">
                <div className="card-header">{allTickets.bucket_name}</div>
                <div className="card-body">
                    <h5 className="card-title">{allTickets.bucket_name}</h5>
                    <p className="card-text">
                        {allTickets.description}
                    </p>
                    <a href="#" className="btn btn-primary">Button</a>
                </div>
                <div class="card-footer text-muted">2 days ago</div>
            </div>
        </>
    )
}
